        alignItems: 'center',
        height: '100px',
        justifyContent: 'space-between',
        position: 'relative',
        padding: '0px 50px',
        boxShadow: '0px 5px 5px rgb(0,0,0,0.5)',
    }
}

class Navbar extends Component {
    render(){
        return (
            <nav style={styles.navbar}>
                <p>Logo</p>
                <p>Carro</p>
            </nav>
        )
    }
}

export default Navbar
